description:
Spacewrights is a tactical sci-fi 2D spaceship simulation game where you explore, build, and create a galactic empire.

If you like FTL: Faster Than Light, you gotta check it out ASAP!

- Explore the galaxy
- Engage in personal fleet combat
- Discover new alien worlds
- Negotiate to control
- Customize your fleet
- Command your crew

